import React from 'react';
import './Home.css';
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate('/Timeline');
  };
  return (
    <div>
      <div className="header">
        <div className="rishi-container">
          <div className="rishi"> rishi. </div>
        </div>
          <div className="route-container">
          <div className="route-item"> Home </div>
          <div className="route-item"> Timeline </div>
          <div className="route-item"> Projects </div>
          <div className="route-item"> Blogs </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
